import Expenseitem from "../Expenses/Expenseitem";
import ExpenseFilter from "../ExpenseFilter/ExpenseFilter";
import { useState } from "react";


const ExpenseTask = (props) => {
 const [filteredYear, setfilteredYear] = useState('');
 const filterCall = (selectedYear) => {
  setfilteredYear(selectedYear);
};

const filtered = props.Expdetails.filter(exp=>exp.thatDay.getFullYear().toString() === filteredYear);
console.log(filtered);

let expensesContent  

 return (
   <div>
            <div className='expenses'>
            <ExpenseFilter selected={filteredYear}  onChangeFilter={filterCall}/>
            {filtered.length === 0 && <p style={{color: "red"}}>No Expenses found</p> }
            {
              filtered.length > 0 &&  filtered.map((expense) => (
                <Expenseitem
                key = {expense.id}
                title={expense.title}
                rate={expense.rate}
                thatDay={expense.thatDay}
                />
                ))
            }
              {/* {filtered.map((expense) => (
                <Expenseitem
                key = {expense.id}
                title={expense.title}
                rate={expense.rate}
                thatDay={expense.thatDay}
                />
                ))} */}
            </div>
          </div>
        );
      }
      export default ExpenseTask;


